import React, { useContext } from 'react';
import { Icon, Menu, Dropdown } from 'semantic-ui-react';
import { useNavigate } from 'react-router-dom';
import { authContext } from '../contexts/AuthContext';

const NavBar = () => {
    const navigate = useNavigate();
    const { logout } = useContext(authContext);

    const handleUserClick = () => {
        navigate('/profile');
    };

    const handleSettingsClick = () => {
        // Handle settings navigation or action
        console.log('Navigate to Settings');
    };

    const handleLogout = () => {
        logout(); // Call logout function from authContext
        navigate('/'); // Redirect to home or login page after logout
    };

    const userOptions = [
        { key: 'profile', text: 'Profile', icon: 'user', onClick: handleUserClick },
        { key: 'settings', text: 'Settings', icon: 'settings', onClick: handleSettingsClick },
        { key: 'logout', text: 'Logout', icon: 'sign-out', onClick: handleLogout },
    ];

    return (
        <div className="flex flex-col">
            {/* TOPBAR */}
            <div className="flex items-center justify-between p-4 bg-white text-white h-16 fixed w-full z-10">
                <div className="flex items-center justify-start w-1/3">
                    <img src="https://react.semantic-ui.com/logo.png" alt="App Logo" className="h-10 w-10" />
                </div>
                <div className="flex items-center justify-center w-1/3">
                    {/* SearchBar component or any other content */}
                </div>
                <div className="flex items-center justify-end w-1/3">
                    {/* Dropdown Menu for user options */}
                    <Dropdown
                        trigger={<Icon name="user circle" size="big" className="cursor-pointer" color="black" />}
                        icon={null}
                    >
                        <Dropdown.Menu>
                            {userOptions.map(option => (
                                <Dropdown.Item key={option.key} {...option} />
                            ))}
                        </Dropdown.Menu>
                    </Dropdown>
                </div>
            </div>
            {/* CONTENT */}
            <div className="flex mt-20">
                {/* SIDEBAR */}
                <Menu vertical fixed="left" className="h-full w-56 bg-white" style={{ marginTop: '7.6rem' }}>
                    <Menu.Item onClick={() => navigate('/')}>
                        <Icon name="sitemap" />
                        Teams
                    </Menu.Item>
                    <Menu.Item>
                        <Icon name="tasks" />
                        Tasks
                    </Menu.Item>
                    <Menu.Item>
                        <Icon name="chat" />
                        Chat
                    </Menu.Item>
                    <Menu.Item>
                        <Icon name="calendar" />
                        Calendar
                    </Menu.Item>
                    <Menu.Item onClick={handleSettingsClick}>
                        <Icon name="settings" />
                        Settings
                    </Menu.Item>
                </Menu>
            </div>
        </div>
    );
};

export default NavBar;
